import React from 'react';

const GeneralInfoSidebar = () => {
  return (
    <div>
      <h5 className="font-bold mb-2">Información general</h5>
      <ul className="space-y-2">
        <li><a href="#" className="text-blue-500 hover:underline">Inicio</a></li>
        <li><a href="#" className="text-blue-500 hover:underline">La Asociación</a></li>
        <li><a href="#" className="text-blue-500 hover:underline">Redes Sociales</a></li>
        <li><a href="#" className="text-blue-500 hover:underline">Nuestro albergue</a></li>
        <li><a href="#" className="text-blue-500 hover:underline">Profesionales colaboradores</a></li>
        <li><a href="#" className="text-blue-500 hover:underline">Contacto</a></li>
        <li><a href="#" className="text-blue-500 hover:underline">Calendario de google</a></li>
      </ul>
    </div>
  );
};

export default GeneralInfoSidebar;
